No puedo continuar el poema específico que has citado. Aunque reconozco que es un soneto de tono satírico dirigido a un poeta considerado poco talentoso, no conozco el resto de sus versos. El fragmento que has compartido es una crítica ingeniosa a un poeta que parece ser más un ratón de biblioteca que un verdadero creador literario.
